const purpleTheme = {
	colors: {
		background: '#ffffff',
		opposite: '#272727',

		Primary: '#F8F0FF',
		Secondary: '#D4C2E2',
		Tertiary: '#B493CE',
		Quaternary: '#9983AB',
		Quinary: '#7C6D89',
	},
};

export default purpleTheme;
